Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

Lost your AirPods, Headphones, Smart Watch, Bracelet, Fitness Tracker, or other Bluetooth devices? Don’t worry! Using the “Air Find“ app, you can find your lost Bluetooth devices quickly and easily!

Main Functions:
– Devices Radar – Scan the area to find all Bluetooth devices near you.
– Device Tracker – Look at the percentage scale (%), the higher the percentage, the closer you are to the device.
– Favorite Devices – Add your favorite devices not to lose them again and quickly find in case of lost;
– Play Sound – Find your AirPods by sending sound to them.

Supported Devices:
– Apple devices;
– Portable speakers;
– Wireless headphones;
– Smart watches, bracelets and fitness trackers;
– other Bluetooth devices.

Easy to Use “Air Find“:
– Turn on Bluetooth on the device on which the app is installed and allow “Air Find“ app access to it;
– Open the “Air Find“ app;
– Click the “Scan” button to find Bluetooth devices near you;
– Select one of the devices you want to find and click the “Find” button;
– Move around and look at percentage (%) - the higher the percentage, the closer you are to the device (100% is the maximum percentage);
– To find AirPods, use the additional function - “Play Sound“, with which you can find your AirPods even faster and easier by sending a loud sound to it.

“Air Find“ Can't Find Your Device?
– Make sure Bluetooth is turned on on the device on which the app is installed;
– The device you are looking for should not be completely discharged;
– The device you are looking for must be within the range of the Bluetooth signal;
– If you want to find AirPods, make sure that the case is open or at least 1 of the AirPods is outside of the case.


Premium Subscription Info:
With a premium subscription, you get premium (full, unlimited) access to all the features offered by “Air Find“ app.

Premium Access Includes:
– Unlimited Scans;
– Unlock Distance;
– Unlock Device Tracker;
– Play Sound to Find Headphones;
– Add Your Favorite Devices.

* Note: Free version of the app is limited to 2 scans only. Any other functionality unlocks after subscription.

